hecked through an automated spam detection service.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Your contact information</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading -->\n<h2>Additional information</h2>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>How we protect your data</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>What data breach procedures we have in place</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>What third parties we receive data from</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>What automated decision making and/or profiling we do with user data</h3>\n<!-- /wp:heading -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3>Industry regulatory disclosure requirements</h3>\n<!-- /wp:heading -->','LUL','','inherit','closed','closed','','3-revision-v1','','','2020-01-17 20:18:08','2020-01-17 20:18:08','',3,'http://doctorsconnect.test/?p=10',0,'revision','',0),(11,1,'2020-01-18 01:18:38','2020-01-18 01:18:38','{\n    \"blogname\": {\n        \"value\": \"Doctors Connect Malaysia\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2020-01-18 01:18:38\"\n    },\n    \"blogdescription\": {\n        \"value\": \"Through Calamity We Connect\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2020-01-18 01:18:38\"\n    }\n}','','','trash','closed','closed','','d9b8c4c7-5916-4ac4-87b0-7af968cf4a0d','','','2020-01-18 01:18:38','2020-01-18 01:18:38','',0,'http://doctorsconnect.test/?p=11',0,'customize_changeset','',0),(12,1,'2020-01-18 01:29:52','2020-01-18 01:29:52','{\n    \"Nebula-master::menu_position\": {\n        \"value\": \"over\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2020-01-18 01:27:07\"\n    },\n    \"Nebula-master::header_nav_scheme\": {\n        \"value\": \"brand\",\n        \"type\": \"theme_mod\",\n        \"user_id\": 1,\n   